import React from "react";
import { Truck, Package, Clock, Globe, PhoneCall } from "lucide-react";
import { Button } from "./ui/Button";
import { Card, } from "./ui/Card";
import Header from "./Header";


export default function RapidGoLanding() {
  return (
    <div className="font-sans text-gray-800 bg-white">
      {/* Navbar */}
      <Header/>
      {/* Hero Section */}
      <section className="bg-gradient-to-r from-blue-900 to-blue-700 text-white py-24 px-8 text-center">
        <h2 className="text-4xl md:text-5xl font-bold mb-4">Fast. Reliable. Logistics.</h2>
        <p className="max-w-2xl mx-auto mb-8">End-to-end transport & supply chain solutions built for speed, safety, and scale.</p>
        <div className="flex justify-center gap-4">
          <Button className="text-white  hover:bg-orange-600">Request a Quote</Button>
          <Button variant="outline" className="text-white  hover:bg-orange-600 border-white">Track Shipment</Button>
        </div>
      </section>

      {/* Services */}
      <section id="services" className="py-20 px-8 bg-gray-400">
        <h3 className="text-3xl font-bold text-center mb-12">Our Services</h3>
        <div className="grid md:grid-cols-4 gap-6 max-w-6xl mx-auto">
          <ServiceCard icon={<Truck />} title="Road Transport" desc="FTL & LTL pan-India transport solutions." />
          <ServiceCard icon={<Package />} title="Warehousing" desc="Secure, scalable storage & distribution." />
          <ServiceCard icon={<Clock />} title="Express Delivery" desc="Time-critical and last-mile delivery." />
          <ServiceCard icon={<Globe />} title="Supply Chain" desc="Optimized end-to-end logistics planning." />
        </div>
      </section>

      {/* Why Choose Us */}
      <section className="py-20 px-8 bg-gray-50">
        <h3 className="text-3xl font-bold text-center mb-12">Why Choose RapidGo</h3>
        <div className="grid md:grid-cols-3 gap-6 max-w-5xl mx-auto">
          <Feature title="99% On-Time Delivery" />
          <Feature title="Real-Time Tracking" />
          <Feature title="24/7 Customer Support" />
        </div>
      </section>

      {/* CTA */}
      <section className="bg-orange-500 text-white py-20 text-center">
        <h3 className="text-3xl font-bold mb-4">Ready to Move Faster?</h3>
        <p className="mb-6">Get a free logistics quote today.</p>
        <Button className="bg-white text-orange-500 hover:bg-gray-100">Get a Quote</Button>
      </section>

      {/* Footer */}
      <footer id="contact" className="bg-gray-900 text-gray-300 py-12 px-8">
        <div className="max-w-6xl mx-auto grid md:grid-cols-3 gap-8">
          <div>
            <h4 className="font-bold text-white text-lg mb-2">RapidGo Logistics</h4>
            <p>Fast & reliable transport across India.</p>
          </div>
          <div>
            <h4 className="font-bold text-white mb-2">Contact</h4>
            <p className="flex items-center gap-2"><PhoneCall size={16}/> +91-XXXXXXXXXX</p>
            <p>contact@rapidgologistics.com</p>
          </div>
          <div>
            <h4 className="font-bold text-white mb-2">Quick Links</h4>
            <p>Services</p>
            <p>Track Shipment</p>
            <p>Careers</p>
          </div>
        </div>
        <p className="text-center text-sm mt-8">Â© 2026 RapidGo Logistics</p>
      </footer>
    </div>
  );
}

function ServiceCard({ icon, title, desc }) {
  return (
    <Card>
      <div className="flex justify-center text-blue-700 mb-4">
        {icon}
      </div>
      <h4 className="font-bold mb-2 text-center">{title}</h4>
      <p className="text-sm text-gray-600 text-center">{desc}</p>
    </Card>
  );
}


function Feature({ title }) {
  return (
    <div className="text-center p-6 border rounded-xl">
      <h4 className="font-semibold">{title}</h4>
    </div>
  );
}
